    false,nt"url": null,nt"notes": "During the summer of 1987 (June 19 to September
    2) a public-use field camp was established at the Ugashik Narrows, Alaska Peninsula
    National Wildlife Refuge to collect site specific public use data. During the 74-day
    survey period, 83 visiting parties with 364 total people were contacted and interviewed.
    The 83 parties spent a total of 565 use-days. Sixty-seven (81%) of the parties utilized
    the Narrows on a day-use basis. Only 16 (19%) parties camped or stayed overnight.
    There were 57 guided parties and 20 unguided parties. The one-day fly in trips for
    the guided parties averaged 4.1 hours use per day. The unguided parties averaged
    3.2 days use. Peak use days were July 6, 7, 20 and 25 with 19, 23, 27 and 22 people
    respectively. A total of 12 different fishing lodges/outfitters utilized the Narrows
    during the survey period.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
